import axios from 'axios';


export const fetchAlcoholicDrinks = (n) =>{
    return (dispatch) => {

        axios.get('http://localhost:4000/api/alcoholicDrinks')
            .then(response => {

                  console.log(response);
                   dispatch({
                    type: 'SET_ALCOHOLIC_DRINKS',
                    alcoholicDrinks: response.data.data
                })
              
            })
            
            .catch(error => {
                console.log(error);
             
            });

        
    }

}
